import { html, LitElement, customElement, property, css } from 'lit-element'

@customElement(`card-primary`)
export class CardPrimary extends LitElement {

  @property({ type: Object })
  data = { name: ``, model: ``, manufacturer: `` }

  static styles = css`
    :host {
      display: block;
      grid-column: span 4;
      margin-top: 30px;
    }

    article {
      height: 100%;
      padding: 30px;
      box-sizing: border-box;
      contain: layout;
      border-radius: 10px;
      background: #EEE;
      box-shadow: 0 2px 5px hsla(0,0%,0%,0.2);
    }

    h1 {
      margin: 0;
      font-size: 1.2rem;
      color: red;
    }

    h2 {
      margin: 0.4em 0 0;
      font-size: 1rem;
    }

    p {
      margin: 1em 0 0;
    }
  `

  render() {
    return html`
      <article>
        <h1>${this.data.name}</h1>
        <h2>${this.data.model}</h2>
        <p>${this.data.manufacturer}</p>
      </article>
    `
  }
}
